import React from 'react';

const Navbar = () => {
    return (
        <nav>
            <ul className="nav-unlog-list">
                <li>
                    <a href="http://localhost:3001"><img src="./img/logo_site.svg"/></a>
                </li>
                <li className="nav-item">Matcha</li>
            </ul>
        </nav>
    );
};

export default Navbar;
